window.addEventListener("message",t=>{if("hsFormCallback"===t.data.type&&"onFormReady"===t.data.eventName){let e=document.querySelectorAll('.contact-form-info .contact-form form input[type="submit"]');for(let i=0;i<e.length;i++)e[i].classList.add("submitinfo"),e[i].setAttribute("id","submitinfo");let a=document.querySelectorAll('.contact-form-admi .contact-form form input[type="submit"]');for(let o=0;o<a.length;o++)a[o].classList.add("submitadmi"),e[o].setAttribute("id","submitadmi")}});